import { useEffect, useState, useContext } from 'react';
import axios from 'axios';
import { CartContext } from '../context/CartContext';
import { AuthContext } from '../context/AuthContext';
import SearchBar from './SearchBar';

function ProductList() {
  // ――― STATE ―――
  const [products, setProducts]   = useState([]);
  const [loading,  setLoading]    = useState(true);
  const [error,    setError]      = useState(null);
  const [recs,     setRecs]       = useState([]);          // ← NEW: recommendations

  // ――― CONTEXT ―――
  const { addToCart } = useContext(CartContext);
  const { user }      = useContext(AuthContext);

  // ――― FETCH ALL PRODUCTS ON MOUNT ―――
  useEffect(() => {
    const fetchProducts = async () => {
      try {
        const { data } = await axios.get('http://localhost:5000/api/products');
        setProducts(data);
        setError(null);
      } catch (err) {
        console.error('Error fetching products:', err);
        setError('Failed to fetch products');
      } finally {
        setLoading(false);
      }
    };
    fetchProducts();
  }, []);

  // ――― FETCH PERSONAL RECOMMENDATIONS (if logged in) ―――
  useEffect(() => {
    if (!user) return;                    // only for logged-in users
    const token = localStorage.getItem('token');
    axios
      .get(`http://localhost:5000/api/recommendations/${user.id}`, {
        headers: { Authorization: `Bearer ${token}` },
      })
      .then(res => setRecs(res.data))
      .catch(err => console.error('Failed to load recommendations', err));
  }, [user]);

  // ――― CALLBACK FOR SEARCH BAR ―――
  const handleSearchResults = results => setProducts(results);

  // ――― RENDER ―――
  return (
    <div>
      <h2>Product Catalog</h2>
      <SearchBar onResults={handleSearchResults} />

      {loading && <p>Loading products...</p>}
      {error   && <p style={{ color: 'red' }}>{error}</p>}
      {!loading && !error && products.length === 0 && <p>No products found.</p>}

      {/* ――― RECOMMENDATIONS SECTION ――― */}
      {user && recs.length > 0 && (
        <>
          <h3>Recommended for you</h3>
          <div style={{ display: 'flex', flexWrap: 'wrap', gap: '20px', marginBottom: '30px' }}>
            {recs.map(p => (
              <div key={`rec-${p._id}`} style={{ border: '2px solid #4caf50', padding: '10px', width: '200px' }}>
                <img src={p.image} alt={p.name} style={{ width: '100%' }} />
                <h4>{p.brand}</h4>
                <p>{p.name}</p>
                <p>${p.price.toFixed(2)}</p>
                <button onClick={() => addToCart(p)}>Add to Cart</button>
              </div>
            ))}
          </div>
        </>
      )}

      {/* ――― REGULAR PRODUCT LIST ――― */}
      <div style={{ display: 'flex', flexWrap: 'wrap', gap: '20px' }}>
        {products.map(p => (
          <div key={p._id} style={{ border: '1px solid #ccc', padding: '10px', width: '200px' }}>
            <img src={p.image} alt={p.name} style={{ width: '100%' }} />
            <h4>{p.brand}</h4>
            <p>{p.name}</p>
            <p>${p.price.toFixed(2)}</p>
            <p>{p.category}</p>
            <button onClick={() => addToCart(p)}>Add to Cart</button>
          </div>
        ))}
      </div>
    </div>
  );
}

export default ProductList;
